import { Avatar } from "@material-ui/core";
import React, { Component } from "react";
import "./InfoSection.css"
import imgSrc from "../../images/images/pp1.png"


class InfoSection extends Component{
    constructor(props){
        super(props);
        this.state = { }
    }
    render(){
        return (
            <div>
                <div className="info_container">
                    <div className="fileupload">
                        <label for="file-upload">
                            <img src={imgSrc} className='mainpage_uploadicon' />
                        </label>
                        <input onChange={this.imgSrc} id="file-upload" type="file" />
                    </div>
                   
                    <div className="info_content">
                        <div className="info_username">bansal</div>
                        <div className="info_description">Description</div>
                    </div>
                </div>
            </div>
        );
    }
}

export default InfoSection ;
